import React from 'react';
import NextCard from './NextCard';

function Home() {
  return (
    <>
      <p className='footer'>Created by Christian Drouin</p>
      <p className='footer'> Feel free to check out my site.</p>
      <a className='footer-link' href={'https://main.d2x40n8b1p7gfc.amplifyapp.com/'} target="_blank" rel="noopener noreferrer"> Click here</a>
      <div className='container'>
        <h1>Sorry!</h1>
        <NextCard />
      </div>
    </>
  );
}

export default Home;
